import React from 'react';
import { HashRouter as Router, Route, Link } from "react-router-dom";
import ScrollAnim from 'rc-scroll-anim';
import content from './SectionsContent';
import CallDialog from './Dialog';
const Element = ScrollAnim.Element;

const find = id => content.find(p => p.id === id);

const Over = ({match}) => {
    let f = find(match.params.id);

    return (

<Element
playScale={0.5}
id={'dial'+f.id}
className='dial'
        style={{ position: 'fixed', height: '100vh',top: 0, zIndex: 1800 }}
>
<CallDialog
d={{
    p: {
        a: f.id
    }
}}/>
</Element>
    )
}
class Dials extends React.Component {
    render() {
        <div>
            <Element
always={true}
appear={true}
playScale={0.5}
id={'dial0'}
        style={{ position: 'fixed', height: '100vh',top: 0 }}
/>
        return (content.map((i) => (
                <Over
                    match={{
                    params: {
                        id: i.id
                    }
                }}/>
        )));
        </div>
    }
}
export default Dials;
